import React from 'react';
import './ProfessionalServicesPage.css';

function ProfessionalServicesPage({ translations }) {
  return (
    <div className="professional-services-page">
      <img src="\images\ProfessionalServices.png" alt="professionalServices" />

      <p className="paragraph-large">{translations.professionalServices.paragraph}</p>

      <div className="service-list">
        <div className="business-solutions">
          <h2>{translations.professionalServices.businessSolutionsHeader}</h2>
          <ul>
            {translations.professionalServices.businessSolutionsList.map((item, index) => (
              <li key={index}>{item}</li>
            ))}
          </ul>
        </div>

        <div className="our-services">
          <h2>{translations.professionalServices.ourServicesHeader}</h2>
          <ul>
            {translations.professionalServices.ourServicesList.map((item, index) => (
              <li key={index}>{item}</li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
}

export default ProfessionalServicesPage;
